import InnerBox from "./innerBox";
const Box = ({ items }) => {
  const boxStyleComponent = {
    border: "1px solid black",
    backgroundColor: "blue",
  };
  const renderedItems = items.map((items) => {
    <InnerBox />;
  });
  return <div style={boxStyleComponent}></div>;
};
export default Box;
